            fiatList.Add(Iso3FiatCodes.ZMW, new CurrencyFiat { Code = Iso3FiatCodes.ZMW, Name = "Zambian Kwacha", DecimalCount = 2, Symbol = "ZMK", Countries = new List<CountryIso2Code>() { CountryIso2Code.FromString(Iso2Codes.ZM) } });
            fiatList.Add(Iso3FiatCodes.ZWD, new CurrencyFiat { Code = Iso3FiatCodes.ZWD, Name = "Zimbabwean dollar", DecimalCount = 2, Symbol = "$", Countries = new List<CountryIso2Code>() { CountryIso2Code.FromString(Iso2Codes.ZW) } });

            return fiatList;
        }

        /// <summary>
        /// Get a GdCountry by Iso2 Code.
        /// </summary>
        /// <param name="gdCountryCode"></param>
        /// <returns>Instance of GdCountry</returns>
        public static CurrencyFiat Get(CurrencyFiatCode gdCountryCode)
        {
            if (GdCurrencyFiatListDict.TryGetValue(gdCountryCode.Code, out CurrencyFiat value))
                return value;

            throw new Exception("Bad Country Code");
        }

        public static CurrencyFiat[] GetAll()
        {
            return GdCurrencyFiatListDict.Values.ToArray();
        }
    }
